const main = () => {
    const canvas = document.getElementById('canvas');
    canvas.height = 800;
    canvas.width = 800;
    const ctx = canvas.getContext('2d');
    if (ctx != undefined) {
        // 長方形に塗りつぶす 左上(100, 100) 幅: 400, 高さ: 400
        ctx.fillStyle = 'green';
        ctx.fillRect(100, 100, 400, 400);
        // 線をひく (100, 0) から (500, 600)
        ctx.strokeStyle = 'gray';
        ctx.lineWidth = 2;
        ctx.beginPath();
        ctx.moveTo(100, 0);
        ctx.lineTo(500, 600);
        ctx.stroke();
        // 円 中心(200, 300) 半径10
        ctx.strokeStyle = 'gray';
        ctx.lineWidth = 2;
        ctx.fillStyle = 'white';
        ctx.beginPath();
        ctx.arc(200, 300, 10, 0, Math.PI * 2, false);
        ctx.fill();
        ctx.stroke();
    }
};
main();

